import './index.css';
import StockDetails from './components/StockDetails'
import OverDetails from './components/OverDetails'
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'

function App() {
  
  return (
      <main>
        <Router>
          <Routes>
            <Route path='/' element={<StockDetails/>} />
            <Route path='/details/:symbol' element={<OverDetails/>} />
          </Routes>
        </Router>
      </main>
  );
}

export default App;
